import React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

function Contact() {
    return (
        <Box
        sx={{
            width: 500,
            maxWidth: "100%",
        }}
        >
            <TextField 
                fullWidth 
                required="true"
                autoFocus="true" 
                margin="normal" 
                label="Your Email" 
                id="fullWidth" 
            />
            <TextField 
                fullWidth 
                margin="normal" 
                label="Subject" 
                id="fullWidth" 
            />
            <TextField 
                fullWidth 
                required="true"
                multiline="true" 
                minRows={8} 
                margin="normal" 
                label="Message" 
                id="fullWidth" 
            />
        </Box>
    );
}

export default Contact;
